export const API_DOG = {
    URL: "https://api.thecatapi.com/v1/images/search?limit=10&breed_ids=beng&api_key=live_bW0hSuN5VbeonaqhrgLyQ0FT37Y2aPFGRKm6I96cGUZSy2XM0lX86QqNc8GbnC8e",


    BREEDS: function(){
        return `${this.URL}/breeds`
    },

    BREEDS_BY_ID: function (id){
        return `${this.URL}/breeds/${id}`
    }


}
